import React from 'react'

class Counter extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            count: 0
        }
    }

    render() {
        return (
            <div>
                <h1>Counter: {this.state.count}</h1>
            </div>
        )
    }
}

export default Counter
